import React,{useState} from 'react'


const ComponentB = () => {
    const [count,setCount]=useState(5)

  return (
      <>
          <div>ComponentB</div>
          <h1>Count Value of B {count}</h1>
          <button onClick={()=>setCount(count+1)}>Increment </button>
      </>
  )
}

export default ComponentB
